import { Router } from "express";

import controllerIndex from "./controllers/controller-index";
import controllerUser from "./controllers/controller-user";

import validateUser from "./middlewares/validateUser";

export default () => {

    const router = Router();

    router.get('/', controllerIndex);

    // get user
    router.get('/user', controllerUser.get);

    // get specific user
    router.get('/user/:_id', controllerUser.get);

    // save user
    router.post('/user', validateUser, controllerUser.save);

    // update user
    router.put('/user/:_id', controllerUser.update);

    // delete user
    router.delete('/user/:_id', controllerUser.delete);

    return router;

}

